import React from 'react';
const TreasureHuntInstructions = () => {
    const styles = {
        treasureHunt: {
            backgroundColor: '#f9f9f9',
            border: '2px solid #ccc',
            borderRadius: '10px',
            padding: '20px',
            maxWidth: '600px',
            margin: '0 auto',
            fontFamily: 'Arial, sans-serif',
        },
        heading: {
            color: '#333',
        },
        paragraph: {
            color: '#666',
        },
        list: {
            listStyleType: 'disc',
            paddingLeft: '20px',
            color: '#666',
        }
    };

    return (
        <div style={styles.treasureHunt}>
            <h2 style={styles.heading}>Treasure Hunt Instructions</h2>
            <p style={styles.paragraph}>Welcome to the treasure hunt adventure! Follow these instructions to embark on your journey:</p>
            <ol style={styles.list}>
                <li>Form teams of 2-4 members.</li>
                <li>Each team will be given a set of clues to solve.</li>
                <li>Use the clues to navigate through different locations.</li>
                <li>At each location, search for hidden items or solve puzzles to reveal the next clue.</li>
                <li>The final clue will lead you to the treasure!</li>
            </ol>
            <h3 style={styles.heading}>Important Guidelines:</h3>
            <ul style={styles.list}>
                <li>Respect all property and follow any rules or regulations in the hunt area.</li>
                <li>Stay safe and be aware of your surroundings at all times.</li>
                <li>Have fun and enjoy the adventure!</li>
            </ul>
        </div>
    );
};

export default TreasureHuntInstructions;
